import React from 'react';

const InputMain = () => {
    return (
        <div>
               <TextField 
            type='number' 
            value={minutesInput} 
            onChange={e => setMinutesInput(parseInt(e.target.value))} 
            />
            <TextField
                color='secondary'
                type='number'
                value={secondsInput}
                onChange={e => setSecondsInput(parseInt(e.target.value))}
            />
        </div>
    );
};

export default InputMain;
